import logo from './logo.svg';
import './App.css';
import Grid from '@material-ui/core/Grid';
import AnchorLink from 'react-anchor-link-smooth-scroll';


function Bio() {
  return (
    <div>
    <div className="App">
        <p>
          Miguel Zurk Cruz
        </p>
    </div>
    <Grid item xs={12}>
      <Grid container>
          <Grid xs={2} item>
            <p><a href="#selv_ikei">Selv Ikei</a></p>
            <p><a href="#opaaco">Opaaco</a></p>
            <p><a href="#casulo">Casulo</a></p>
          </Grid>
          <Grid xs={2} item>
            <div id="personas_projects">
            </div>
          </Grid>
          <Grid xs={8} item>
            <p>Projecto</p>
          </Grid>
      </Grid>
    </Grid>
    </div>
  );
}

export default Bio;
